import React from "react";

const WelcomePage = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h1>Welcome to the Website!</h1>
      <p>You have successfully logged in.</p>
    </div>
  );
};

export default WelcomePage;
